import React from 'react';
import './styles.scss';
import sidebarItems from './sidebarItems';

const Sidebar = () => {
  return (
    <div className="sidebar-wrapper">
      <ul>
        {
          sidebarItems.map((item) => {
            <Link>
            <img src={require('../../assets/images/document-icon.svg')} alt="icon" />
            </Link>
          })
        }
      </ul>
    </div>
  );
};

export default Sidebar;
